Estimados Voluntarios y amigos;

Les comento que sólo por los meses de Enero y Febrero arrendaremos nuestros BOX a $ 4.000 la sesión. Estos están ubicados en al frente del Parque Bustamante, a pasos del metro Baquedano, son silenciosos y cuentan con un amplio baño y cocina. Los que estén interesados en periodos más largos respetaremos el precio aquí señalado. favor enviar mail a khermosilla@psicologosvoluntarios.cl y coordinar con ella la reserva de los BOX.

Saludos y sigamos ayudando

Estimados Voluntarios y amigos;

Estamos haciendo varios cambios, en nuestro equipo, en la pàgina web, en la administración de nuestras redes sociales y formas de trabajar. No ha sido fácil, pero con el apoyo que estamos recibiendo de ustedes podremos sacar adelante esta bella ONG que partió hace ya casi 5 años.

Si estas interesado en ayudar escríbenos a contacto@psicologosvoluntarios.cl o comenta este mismo mensaje.
